import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import Home from "../Pages/Home/Home"
function Routes() {
  return (
    
    <Routes>
            <Route path='/'> <Home/> </Route>
    </Routes>
  )
}

export default Routes
